#audio{
position:absolute;z-index:99999;
overflow:hidden;
height:80px;
opacity:.05;
bottom:0;
right:0;
margin:0 20px 20px 0;transform:scale(.8);
z-index:99999999;
}
#audio:hover{
    opacity:.3;
}



.window, .iframe{
  background-color:black;
  height:400px;
  width:400px;
  opacity:1;
  transition:opacity 1s ease, filter 2s ease, transform 6s ease;
  filter:blur(40px);
  margin:-100px 0 0 -100px;
  display:block;
  position:absolute;
  z-index:99999999999999;
  transform:scale(.2);
  cursor:pointer;
  overflow:hidden;
  border-radius:80px;

}
.iframe{
  height:800px;
  width:600px;  
}
.iframe:hover, .window:hover{
  margin:-110px 0 0 -100px;
}
.window img{
    height:200px;
    width:200px;
}
